class XOR128{constructor(t=4294967296*Math.random(),n=4294967296*Math.random(),r=4294967296*Math.random(),i=4294967296*Math.random()){if(t<1||n<1||r<1||i<1)throw new Error("Invalid seed");this.x=t,this.y=n,this.z=r,this.w=i}_next_integer(){const t=this.x^this.x<<11>>>0;return this.x=this.y,this.y=this.z,this.z=this.w,this.w=(this.w^this.w>>>19^t^t>>>8)>>>0,this.w}random(t,n){return null==t&&null==n?(t=0,n=1):null==n&&(n=t,t=0),this._next_integer()/4294967296*(n-t)+t}random_int(t,n){return null==t&&null==n?(t=0,n=2):null==n&&(n=t,t=0),Math.floor(this._next_integer()/4294967296*(n-t))+t}random_interval(t=.5,n=.5){return this.random(t-n,t+n)}random_from_array(t){return t[this.random_int(0,t.length)]}shuffle_array(t){for(let n=t.length-1;n>0;n--){const r=this.random_int(0,t.length);[t[n],t[r]]=[t[r],t[n]]}}shuffle_string(t){t.split("").sort((t,n)=>this.random(-1,1)).join("")}}
